function() {
  var el = {{Visible Element Advanced}};
  if (!el) return 'unknown';

  // 1) Buscar atributos especiales
  var name = el.getAttribute('data-section-name') || el.getAttribute('aria-label') || el.getAttribute('data-section');
  if (name) return name.trim();

  // 2) Buscar aria-labelledby
  var lblId = el.getAttribute('aria-labelledby');
  if (lblId) {
    var lbl = document.getElementById(lblId) || el.querySelector('#' + lblId);
    if (lbl && lbl.textContent) return lbl.textContent.trim();
  }

  // 3) Buscar headings y títulos dentro
  var h = el.querySelector('h1, h2, h3, h4, [data-title], .section-title, .hero-title, [role="heading"]');
  if (h && h.textContent) return h.textContent.trim().substring(0, 50);

  // 4) Mapeo específico por ID para Contadoor
  var id = el.id;
  var sectionMap = {
    'hero': 'Hero Section',
    'servicios': 'Servicios',
    'como-funciona': 'Cómo Funciona',
    'cotizador': 'Cotizador',
    'testimonios': 'Testimonios',
    'testimonials': 'Testimonios',
    'faq': 'FAQ',
    'contacto': 'Contacto',
    'contact': 'Contacto',
    'problema': 'Problema',
    'solucion': 'Solución',
    'beneficios': 'Beneficios',
    'pricing': 'Precios',
    'footer': 'Footer'
  };
  if (id && sectionMap[id]) return sectionMap[id];

  // 5) Detectar por clases comunes
  var className = el.className && (el.className.baseVal || el.className).toString();
  if (className) {
    if (className.includes('hero')) return 'Hero Section';
    if (className.includes('service')) return 'Servicios';
    if (className.includes('testimonial')) return 'Testimonios';
    if (className.includes('faq')) return 'FAQ';
    if (className.includes('contact')) return 'Contacto';
    if (className.includes('pricing')) return 'Precios';
  }

  // 6) Fallback: formatear ID
  if (id) {
    var formatted = id.replace(/[-_]+/g, ' ').replace(/\s+/g, ' ').trim();
    return formatted.replace(/\b\w/g, function(m) { return m.toUpperCase(); });
  }

  return 'Section';
}
